import React from "react";
import {
    BrowserRouter as Link
} from "react-router-dom";
import "./App.css";


export default function SignUp() {
    return (
        <div class="login-header">
            <h2>Sign Up</h2>
            <input id="login-box" type="username" placeholder="new username">
            </input>
            <input id="login-box" type="password" placeholder="new password">
            </input>
            <Link to="/sign_up_info">
                <button type="submit">Sign Up</button>
            </Link>
        </div>
    );
}
